"""

```
Pseudocdigo
algoritmo Subida  Colina num Espao Discreto 
    NAtual := NInicial
    lao faa
        L := VIZINHOS(NAtual)
        valorFunoAvaliao := INFINITO
        PrximoN := NULL
        para todos x em L faa
            se AVALIE(x) > valorFunoAvaliao ento
                PrximoN := x
                valorFunoAvaliao := AVALIE(x)
        se valorFunoAvaliao  AVALIE(NAtual) ento
            # Retorne o n atual j que nenhum n vizinho  melhor
            retorne NAtual
        NAtual := PrximoN
```
[Wikipedia](https://en.wikipedia.org/wiki/Hill_climbing)

"""

import math

caminhosX = []
caminhosY = []
valoresFuncao = []

def vizinhos(noAtual, passo=0.1):
  x, y = noAtual
  return [(x+passo,y), (x-passo,y), (x,y+passo), (x,y-passo),
          (x+passo,y+passo), (x-passo,y-passo), (x-passo,y+passo), (x+passo,y-passo)]

def funcaoAvaliacao(no):
  x, y = no
  return math.exp(-(x ** 2 + y ** 2)) + 2* math.exp(-((x-1.7) ** 2 + (y-1.7) ** 2))

def hillClimbing(noInicial):
  global caminhosX, caminhosY, valoresFuncao
  noAtual = noInicial
  x,y = noAtual
  caminhosX.append(x)
  caminhosY.append(y)
  valoresFuncao.append(funcaoAvaliacao(noAtual))
  #print(f'({x:.1f}, {y:.1f}) - {funcaoAvaliacao(noAtual):.2f}')
  while True:
    L = vizinhos(noAtual)
    valorFuncaoAvaliacao = float('-inf')
    proximoNo = None
    for x in L:
      avaliacao = funcaoAvaliacao(x)
      if avaliacao > valorFuncaoAvaliacao:
        proximoNo = x
        valorFuncaoAvaliacao = avaliacao
    if valorFuncaoAvaliacao <= funcaoAvaliacao(noAtual):
        return noAtual
    noAtual = proximoNo
    x,y = noAtual
    caminhosX.append(x)
    caminhosY.append(y)
    valoresFuncao.append(funcaoAvaliacao(noAtual))
    #print(f'({x:.1f}, {y:.1f}) - {funcaoAvaliacao(noAtual):.2f}')

inicio = (0.5,0.5)
print('Comeando em', inicio)
maximo = hillClimbing(inicio)
x,y = maximo
print(f'({x:.1f}, {y:.1f}) - {funcaoAvaliacao(maximo):.2f}')

inicio = (2,2)
print('Comeando em', inicio)
maximo = hillClimbing(inicio)
x,y = maximo
print(f'({x:.1f}, {y:.1f}) - {funcaoAvaliacao(maximo):.2f}')

inicio = (0,0)
print('Comeando em', inicio)
maximo = hillClimbing(inicio)
x,y = maximo
print(f'({x:.1f}, {y:.1f}) - {funcaoAvaliacao(maximo):.2f}')

inicio = (-1.5,-1.5)
print('Comeando em', inicio)
maximo = hillClimbing(inicio)
x,y = maximo
print(f'({x:.1f}, {y:.1f}) - {funcaoAvaliacao(maximo):.2f}')

import numpy.random as r

def reinicioAleatorio(dominioXa, dominioXb, dominioYa, dominioYb, numPassos=100):
  global caminhosX, caminhosY, valoresFuncao
  caminhosX = []
  caminhosY = []
  valoresFuncao = []
  valorMaximoGlobal = float('-inf')
  noMaximoGlobal = None
  for i in range(numPassos):
    inicioX = r.uniform(dominioXa, dominioXb)
    inicioY = r.uniform(dominioYa, dominioYb)
    noMaximoLocal = hillClimbing((inicioX, inicioY))
    valorMaximoLocal = funcaoAvaliacao(noMaximoLocal)
    if valorMaximoLocal  > valorMaximoGlobal:
      noMaximoGlobal = noMaximoLocal
      valorMaximoGlobal = valorMaximoLocal
  
  return noMaximoGlobal


maximoGlobal = reinicioAleatorio(-2, 4, -2, 4)
x,y = maximoGlobal
print(f'({x:.1f}, {y:.1f}) - {funcaoAvaliacao(maximoGlobal):.2f}')

